import React from 'react';
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import Header from "../../_layouts/_includes/header/Header";
import Drawer from "../../_layouts/_includes/drawer/Drawer";
import Content from "../../_layouts/_includes/content/Content";
import Footer from "../../_layouts/_includes/footer/Footer";

class NotFound extends React.Component {
    render() {
        return (
            <>
                <Header/>
                <Drawer/>
                <Content>
                    <Box display="flex" justifyContent="center" m="auto">
                        <Typography align="center" variant="h4">
                            Not Found | 404
                        </Typography>
                    </Box>
                    <Footer/>
                </Content>
            </>
        );
    }
}

export default NotFound
